import { Component, OnInit } from '@angular/core';
import { DataService } from '../../data.service';

@Component({
  selector: 'app-resultados',
  templateUrl: './resultados.component.html',
  styleUrls: ['./resultados.component.css'],
})
export class ResultadosComponent implements OnInit {
  mensaje: string = '';
  userData: any;
  edad: number | undefined;
  signoZodiacal: string | undefined;
  urlImagen: string | undefined;
  calificacion: number = 0;
  respuestasCorrectas: Set<string> = new Set<string>();
  respuestasUsuario: Set<string> = new Set<string>();

  constructor(private dataService: DataService) { }

  respuestasCorrectasUsuario: Set<string> = new Set<string>();
  setUserData(data: any) {
    this.userData = data;
  }

  ngOnInit(): void {
    // Obtener la información del usuario
    this.userData = this.dataService.userData;

    // Algun componente donde recopilas datos del usuario
    this.dataService.setUserData(this.userData);

    // Calcular la edad
    this.edad = this.calcularEdad(
      this.userData.año,
      this.userData.mes,
      this.userData.dia
    );

    // Calcular el signo zodiacal
    this.signoZodiacal = this.calcularSignoZodiacal(this.userData.año);

  // Subscribirse a cambios en la calificación
  this.dataService.calificacion$.subscribe((calificacion) => {
    // Actualizar la calificación
    this.calificacion = calificacion;
      // Obtener la URL de la imagen después de que la calificación se haya actualizado
      this.urlImagen = this.signoZodiacal
        ? this.obtenerUrlImagen(this.signoZodiacal)
        : undefined;

      // Crear el mensaje completo
      this.mensaje = `Hola ${this.userData.nombre} ${this.userData.apaterno} ${this.userData.amaterno}`;
    });

    // Establecer la calificación inicial
    this.calificacion = this.dataService.getCalificacion();
  }

  // Método para calcular la edad
  calcularEdad(año: number, mes: number, dia: number): number | undefined {
    const fechaNacimiento = new Date(año, mes - 1, dia);
    const ahora = new Date();

    let edad = ahora.getFullYear() - fechaNacimiento.getFullYear();

    // Ajustar la edad si aún no ha pasado el cumpleaños en este año
    if (
      ahora.getMonth() < fechaNacimiento.getMonth() ||
      (ahora.getMonth() === fechaNacimiento.getMonth() &&
        ahora.getDate() < fechaNacimiento.getDate())
    ) {
      edad--;
    }

    return edad;
  }

  // Método para calcular el signo zodiacal
  calcularSignoZodiacal(año: number): string | undefined {
    const signos = [
      { signo: 'Rata', rango: [1900, 1912, 1924, 1936, 1948, 1960, 1972, 1984, 1996, 2008, 2020] },
      { signo: 'Búfalo', rango: [1901, 1913, 1925, 1937, 1949, 1961, 1973, 1985, 1997, 2009, 2021] },
      { signo: 'Tigre', rango: [1902, 1914, 1926, 1938, 1950, 1962, 1974, 1986, 1998, 2010, 2022] },
      { signo: 'Conejo', rango: [1903, 1915, 1927, 1939, 1951, 1963, 1975, 1987, 1999, 2023] },
      { signo: 'Dragón', rango: [1904, 1916, 1928, 1940, 1952, 1964, 1976, 1988, 2000, 2012, 2024] },
      { signo: 'Serpiente', rango: [1905, 1917, 1929, 1941, 1953, 1965, 1977, 1989, 2001, 2013, 2025] },
      { signo: 'Caballo', rango: [1906, 1918, 1930, 1942, 1954, 1966, 1978, 1990, 2002, 2014, 2026] },
      { signo: 'Cabra', rango: [1907, 1919, 1931, 1943, 1955, 1967, 1979, 1991, 2003, 2015, 2027] },
      { signo: 'Mono', rango: [1908, 1920, 1932, 1944, 1956, 1968, 1980, 1992, 2004, 2016, 2028] },
      { signo: 'Gallo', rango: [1909, 1921, 1933, 1945, 1957, 1969, 1981, 1993, 2005, 2017, 2029] },
      { signo: 'Perro', rango: [1910, 1922, 1934, 1946, 1958, 1970, 1982, 1994, 2006, 2018, 2030] },
      { signo: 'Cerdo', rango: [1911, 1923, 1935, 1947, 1971, 1983, 1995, 2007, 2019, 2031] },
    ];

    for (const signo of signos) {
      if (signo.rango.includes(año)) {
        return signo.signo;
      }
    }

    return undefined;
  }

  // Método para obtener la URL de la imagen según el signo zodiacal
      obtenerUrlImagen(signoZodiacal: string): string {
    const urlsImagenes: Record<string, string> = {
      'Rata': 'data:image/jpeg;base64,',
      'Búfalo': 'data:image/jpeg;base64,',
      'Tigre': 'data:image/jpeg;base64,',
      'Conejo': 'data:image/jpeg;base64,',
      'Dragón': 'data:image/jpeg;base64,',
      'Serpiente': 'data:image/jpeg;base64,',
      'Caballo': 'data:image/jpeg;base64,',
      'Cabra': 'data:image/jpeg;base64,',
      'Mono': 'data:image/jpeg;base64,',
      'Gallo': 'data:image/jpeg;base64,',
      'Perro': 'data:image/jpeg;base64,',
      'Cerdo': 'data:image/jpeg;base64,',
    };

    return urlsImagenes[signoZodiacal] || '';
  }
  // Método para calcular la calificación
  calcularCalificacion() {
    if (this.respuestasCorrectasUsuario) {
      this.calificacion = this.respuestasCorrectasUsuario.size;
    } else {
      this.calificacion = 0;
    }
    console.log('Calificación calculada:', this.calificacion);
  }
}
